import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import ExpertRegistration from './components/ExpertRegistration';
import DspRegistration from './components/DspRegistration';
import WorkplaceRegistration from './components/WorkplaceRegistration';
import Accounting from './components/Accounting';
import DataImport from './components/DataImport';
import ExpertCardPage from './components/ExpertCardPage';
import DoctorCardPage from './components/DoctorCardPage';
import DspCardPage from './components/DspCardPage';
import Navbar from './components/Navbar';
import DashboardTest from './components/DashboardTest'; // Add test component
import './App.css';

// Wrapper components to include Navbar with proper routing context
const DashboardPage = () => (
  <Dashboard key={Date.now()} /> // Add key to force re-creation
);

const ExpertPage = () => (
  <>
    <Navbar />
    <ExpertCardPage />
  </>
);

const DoctorPage = () => (
  <>
    <Navbar />
    <DoctorCardPage />
  </>
);

const DspPage = () => (
  <>
    <Navbar />
    <DspCardPage />
  </>
);

const WorkplacePage = () => (
  <>
    <Navbar />
    <WorkplaceRegistration />
  </>
);

const AccountingPage = () => (
  <>
    <Navbar />
    <Accounting />
  </>
);

const DataImportPage = () => (
  <>
    <Navbar />
    <DataImport />
  </>
);

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/dashboard" element={<DashboardPage />} />
          <Route path="/experts" element={<ExpertPage />} />
          <Route path="/doctors" element={<DoctorPage />} />
          <Route path="/dsps" element={<DspPage />} />
          <Route path="/workplaces" element={<WorkplacePage />} />
          <Route path="/accounting" element={<AccountingPage />} />
          <Route path="/data" element={<DataImportPage />} />
          <Route path="/test" element={<DashboardTest />} /> {/* Add test route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
